import service from '../index.js';
//获取首页轮播图
export function getBanner() {
    return service({
        method: 'GET',
        url: '/banner?type=2'
    })
}
//获取发现好歌单
export function getMusicList() {
    return service({
        method: 'GET',
        url: '/personalized?limit=10'
    })
}
export function getSearchResult(data) {
    return service({
        method: 'GET',
        url: `/cloudsearch?keywords=${data}`
    })
}
export function getCode() {
    return service({
        method: 'GET',
        url: `/login/qr/key`
    })
}
export function getQRCode() {
    return getCode().then(result => {
        return service({
            method: 'GET',
            url: `/login/qr/create?key=${result.data.data.unikey}&qrimg=${result.data.data.unikey}`
        })
    })
}
